            </li>
            <li>
              <Link to="/solved-complaints">ÃÃ¶zÃ¼mlenmiÅ ArÄ±zalar</Link>
            </li>
            <li>
              <Link to="/user-complaints">KullanÄ±cÄ± ArÄ±zalarÄ±</Link>
            </li>
            <li>
              <Link to="/create-complaint">ArÄ±za OluÅtur</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/register" element={<RegisterPage />} />
          <Route path="/login" element={<LoginPage handleLogin={handleLogin} />} />
          <Route path="/admin" element={<AdminPanel />} />
